INSERT INTO `Products` (`ID`, `Name`, `Description`, `Release_date`, `End_date`, `Quantity`, `Price`, `Category`, `Manufacturer`, `Picture`) VALUES
(1, 'Impact Whey Protein', 'It is made-up of 100% premium grade whey protein concentrate and has 20g of protein per serving (80%). This has a comprehensive amino acid profile providing all the essential amino acids (EAA''s) and contains over 2g of Leucine per serving. If youâ€™re looking for a premium quality whey protein powder which delivers exceptional value for money and incredible taste, look no further.', '2010-01-24', '2020-01-24', 70, 12.69, 'Protein', 'Glanbia Nutritionals', ),
(2, 'Impact Diet Whey', 'Impact Diet Whey is a great tasting supplement which contains a unique blend of Whey Protein and Milk Protein Concentrate combined with a low carbohydrate content sourced from low GI (Glycaemic Index) carbohydrates. Impact Diet Whey also has a number of added ingredients including Green Tea Extract, Acetyl-L-Carnitine and Essential Fatty Acids.', '2010-03-24', '2020-03-24', 50, 19.49, 'Protein', 'Glanbia Nutritionals', );
INSERT INTO `Products` (`ID`, `Name`, `Description`, `Release_date`, `End_date`, `Quantity`, `Price`, `Category`, `Manufacturer`, `Picture`) VALUES
(3, 'Micellar Casein', 'Micellar Casein is a, slow release protein derived from milk. It''s absorbed slowly by the stomach allowing a tapered supply of amino acids to the muscle over a prolonged period of time. This makes Micellar Casein the ideal protein supplement for between meals and before bed. During sleep, the body is normally starved of nutrients as it is impractical to consume food and therefore, a slow release protein can be ideal for recovery throughout the night.', '2010-02-24', '2020-02-24', 60, 17.99, 'Protein', 'Glanbia Nutritionals', ),
(4, 'Impact Whey Isolate', 'Impact Whey Isolate is the purest whey protein available, containing over 90% protein with a low fat (0.25g) and carbohydrate (0.17g) content per serving, which is lower than most other whey protein powders. It has a comprehensive amino acid profile providing all the essential amino acids (EAA''s) and has over 2g of Leucine per serving.', '2010-03-24', '2020-03-24', 36, 19.59, 'Protein', 'MyProtein', );
INSERT INTO `Products` (`ID`, `Name`, `Description`, `Release_date`, `End_date`, `Quantity`, `Price`, `Category`, `Manufacturer`, `Picture`) VALUES
(5, 'Soy Protein Isolate', 'Soy Protein Isolate is made from 100% NON-GMO defatted soy beans suing a stringent process which removes a vast majority of the fat and carbohydrate content. The resulting product yields over 90% protein content with minimal fat and carbohydrate, whilst being completely free of lactose. Soy Protein Isolate is the boasts a comprehensive amino acid profile - including 6.6g Leucine per 100g.', '2010-04-24', '2020-04-24', 74, 11.99, 'Protein', 'MyProtein', ),
(6, 'Protein Pancake Mix', 'The Myprotein pancake mix is a ready to make delicious high protein snack, containing a combination of three different types of protein, whey, milk and egg protein.', '2010-07-24', '2020-07-24', 16, 4.99, 'Protein', 'MyProtein', );
INSERT INTO `Products` (`ID`, `Name`, `Description`, `Release_date`, `End_date`, `Quantity`, `Price`, `Category`, `Manufacturer`, `Picture`) VALUES
(7, 'Vegan Blend', 'Vegan Blend combines Pea Protein Isolate, Brown Rice Protein and Hemp Protein to deliver a premium quality, vegan protein powder with a full range of essential amino acids and over 22g of protein per serving.', '2010-05-24', '2020-05-24', 75, 17.99, 'Protein', 'Glanbia Nutritionals', ),
