INSERT INTO `Products` (`ID`, `Name`, `Description`, `Release_date`, `End_date`, `Quantity`, `Price`, `Category`, `Manufacturer`, `Picture`) VALUES
(13, 'Total Breakfast', 'Total Breakfast is the ultimate morning shake, packed with all the key nutrients you need to kick start your day. Each serving contains a protein blend of whey protein concentrate, milk protein and egg albumin as well as a carbohydrate blend of Ground Oats and Activated Barley, and essential fatty acids. Also included are colostrum and vitamins and minerals. Finally, the inclusion of ChocamineÂ® Plus provides approximately 20mg caffeine and 12mg polyphenols per serving.', '2010-03-24', '2020-03-24', 65, 27.99, 'Protein', 'MyProtein', ),
