INSERT INTO `Products` (`ID`, `Name`, `Description`, `Release_date`, `End_date`, `Quantity`, `Price`, `Category`, `Manufacturer`, `Picture`) VALUES
(15, 'Brown Rice Protein', 'Brown Rice Protein is the concentrated fraction of the whole rice grain which is produced through a wet milling and all natural proprietary process. It is produced by various steps of fermentation, filtration processing and enzymatic processing to remove the protein and fiber from whole grain brown rice. The basis for this process is sprouted whole grain brown rice which is the raw material for production. Brown Rice Protein uses non-GMO sprouted brown rice and it is hypo-allergenic and completely dairy and lactose free.', '2010-06-24', '2020-06-24', 25, 15.99, 'Protein', 'Glanbia Nutritionals', ),
(16, 'Hemp Protein', 'Hemp Protein is an excellent source of protein derived from whole raw hemp seed. Hemp Protein contains a comprehensive amino acid blend and is packed with live enzymes, Essential Fatty Acids (EFA), vitamins and minerals. Hemp Seeds are rich in essential nutrients including chlorophyll, magnesium, potassium, sulphur, phytosterols, ascorbic acid, beta-carotene, calcium, fibre, histidine, iron, potassium, phosphorus, riboflavin, niacin and thiamine.', '2010-02-24', '2020-02-24', 75, 19.99, 'Protein', 'Glanbia Nutritionals', );
